import numpy as np
from fedprototype import BaseClient
from encrypt.paillier import PaillierKeypair
import math
from components.algorithms.vertical.train_clients import ActiveTrainClient, PassiveTrainClient


def get_active_run_kwargs(fileName):
    # 把给active的数据写到这里
    data_active = [];
    label = []
    id_list = []
    count = 0
    fr = open(fileName, 'r')
    for line in fr.readlines():
        curLine = line.strip().split(',')
        label.append([float(curLine[8])])
        data_active.append([float(num) for num in curLine[0:4]])
        id_list.append(count)
        count = count + 1
    return {'features': data_active, 'label': label, 'id_list': id_list}


def get_passive_run_kwargs(fileName):
    data_passive = []
    id_list = []
    count = 0
    fr = open(fileName, 'r')
    for line in fr.readlines():
        curLine = line.strip().split(',')
        data_passive.append([float(num) for num in curLine[4:8]])
        id_list.append(count)
        count = count + 1
    return {'features': data_passive, 'id_list': id_list}


if __name__ == '__main__':
    from fedprototype.envs import LocalEnv

    datafile = "./diabetes.csv"  # 糖尿病人数据
    alpha = 0.001  # 学习率
    epoch = 100
    feature_size = 4  # 特征维度

    env = LocalEnv()
    env.add_client(client=ActiveTrainClient(role_name="Active", alpha=alpha, batch_size=32, epoch=epoch,
                                            feature_size=feature_size), **get_active_run_kwargs(datafile))
    env.add_client(client=PassiveTrainClient(role_name="Passive", alpha=alpha, batch_size=32, epoch=epoch,
                                             feature_size=feature_size), **get_passive_run_kwargs(datafile))
    env.run()

